import { PlusOutlined } from '@ant-design/icons';

function App() {
  //const [data, setData] = useState([]);
  const data = [
    {
      name: 'n',
      date: "d",
      status: "s",
      notes: "n"
    }
  ]
  const menu = (
    <Menu
      onClick={handleNew}
      items={[
        {
          label: 'new internship',
          key: '1',
          icon: <PlusOutlined />,
        },
      ]}
    />
  );
  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Date',
      dataIndex: 'date',
      key: 'date',
    },
    {
      title: 'Status',
      dataIndex: 'status',
      key: 'status',
    },
    {
      title: 'Notes',
      dateIndex: 'notes',
      key: 'notes',
    }
  ];
  const handleNew = () => {
    const newData = {
      name: "n",
      date: "d",
      status: "s",
      notes: "none"
    }
    console.log("done");
    // setData(
    //   pre => { return [...pre, newData] }
    // )
  };
  return (
    <div>
      <div className="App-header">
        <Dropdown overlay={menu}>
          <Button>
            <Space>
              <PlusOutlined />
            </Space>
          </Button>
        </Dropdown>
        <Table columns={columns} data={data} />
      </div>
    </div>
  );
}

export default App;
